%[text] Step 1: Create Trapezoidal Velocity Trajectories
clear;
close all;
clc;
%%
%[text] (1a) Calculate arc length of Lissajous Curve.
% TODO: replace T, xd, yd with your our lissajous curve
T = 2*pi;
t = linspace(0,T,1000);
xd = 0.12*sin(3*t);
yd = 0.145*sin(2*t);
d = 0;
for i=1:length(t)-1
    d = d + sqrt( (xd(i+1) - xd(i))^2 + (yd(i+1) - yd(i))^2 );
end
%%
%[text] Determine the average speed, $c$, of end effector over `tfinal` seconds.
% TODO: replace tfinal with your code
tfinal = 11;

% calculate average speed
c = d/tfinal;
%%
%[text] Use forward-euler method to numerically approximate $\\alpha(t)$
% normalized trapezoidal curve
g = @(t, T, ta) (T/(T-ta))*((t < ta) .* (t / ta) + (t >= ta & t <= (T - ta)) .* 1 + (t > (T - ta)) .* ((T - t) / ta));

dt = 0.002;
t = 0:dt:tfinal;
alpha = zeros(size(t));
ta = tfinal/4;
for i=1:length(t)-1
    xdot = 0.12 * 3 * cos(3 * alpha(i));
    ydot = 0.145 * 2 * cos(2 * alpha(i));  
    % equation (7) in the lab assignment
    alpha_dot = c * g(t(i), tfinal, ta) / sqrt(xdot^2 + ydot^2);
    alpha(i+1) = alpha(i) + dt * alpha_dot;
end

plot(t,alpha,'LineWidth',2); title('Plot of \alpha(t)'); %[output:0bd728f4]
grid on; xlabel('time (s)'); ylabel('\alpha(t)'); %[output:0bd728f4]
yline(T,'k--','LineWidth',2);  %[output:0bd728f4]
legend('\alpha','T (period)','Location','southeast') %[output:0bd728f4]
%%
%[text] (1c) Combine all trajectories together.
% TODO: replace with your own lissajous curve
x = 0.12*sin(3*alpha);
y = 0.145*sin(2*alpha);
%%
%[text] Plot the speed of the trajectory as function of time.
v = sqrt( (diff(x)/dt).^2 + (diff(y)/dt).^2 );
plot(dt:dt:tfinal,v,'LineWidth',3); hold on; %[output:5896560f]
yline(c,'w--');  %[output:5896560f]
ylim([0 0.3]) %[output:5896560f]
yline(0.25,'r--') %[output:5896560f]
hold off; %[output:5896560f]
title('Trajectory Velocity') %[output:5896560f]
grid on; %[output:5896560f]
xlabel('time (s)') %[output:5896560f]
ylabel('velocity (m/s)') %[output:5896560f]
legend('velocity', 'average velocity', 'velocity limit','Location','south') %[output:5896560f]

%%
%[text] ## Step 2: Forward Kinematics
%[text] (2c) Calculate T0
% these values were obtained from the URDF directly
L1 = 0.2435;
L2 = 0.2132;
W1 = 0.1311;
W2 = 0.0921;
H1 = 0.1519;
H2 = 0.0854;

% home position of end effector
M = [-1 0 0 L1+L2;
    0 0 1 W1+W2;
    0 1 0 H1-H2;
    0 0 0 1];

% screw axes
S1 = [0 0 1 0 0 0]';
S2 = [0 1 0 -H1 0 0]';
S3 = [0 1 0 -H1 0 L1]';
S4 = [0 1 0 -H1 0 L1+L2]';
S5 = [0 0 -1 -W1 L1+L2 0]';
S6 = [0 1 0 H2-H1 0 L1+L2]';
S = [S1 S2 S3 S4 S5 S6];

% body screw axes
B1 = ECE569_Adjoint(M)\S1;
B2 = ECE569_Adjoint(M)\S2;
B3 = ECE569_Adjoint(M)\S3;
B4 = ECE569_Adjoint(M)\S4;
B5 = ECE569_Adjoint(M)\S5;
B6 = ECE569_Adjoint(M)\S6;
B = [B1 B2 B3 B4 B5 B6];

% joint angles
theta0 = [-1.6800   -1.4018   -1.8127   -2.9937   -0.8857   -0.0696]';

% calculate the 4x4 matrix representing the transition
% from end effector frame {b} to the base frame {s} at t=0: Tsb(0)

% TODO: implement ECE569_FKinSpace and ECE569_FKinBody
T0_space = ECE569_FKinSpace(M,S,theta0) %[output:89b5ec50]
T0_body = ECE569_FKinBody(M,B,theta0) %[output:9b10ec18]
T0_space-T0_body %[output:2dfed344]
T0 = T0_body;
%[text] Calculate Tsd at every time step.
% Calculate Tsd(t) for t=0 to t=tfinal
% Tsd(t) = T0 * Td(t)
N = length(t);
Tsd = zeros(4,4,N);
Rd = eye(3); 
for i=1:N
    pd = [x(i); y(i); 0];
    Td = [Rd, pd;
          0 0 0 1];
    Tsd(:,:,i) = T0 * Td;
end
%%
%[text] (2d) Plot (x,y,z) in the s frame
xs = Tsd(1,4,:);
ys = Tsd(2,4,:);
zs = Tsd(3,4,:);
plot3(xs(:), ys(:), zs(:), 'LineWidth', 1) %[output:31082f9a]
title('Trajectory \{s\} frame') %[output:31082f9a]
xlabel('x (m)') %[output:31082f9a]
ylabel('y (m)') %[output:31082f9a]
zlabel('z (m)') %[output:31082f9a]
hold on %[output:31082f9a]
plot3(xs(1),ys(1),zs(1),'go','MarkerSize',10,'LineWidth',2) %[output:31082f9a]
plot3(xs(end),ys(end),zs(end),'rx','MarkerSize',10,'LineWidth',2) %[output:31082f9a]
legend('Trajectory', 'Start', 'End') %[output:31082f9a]
grid on %[output:31082f9a]
hold off %[output:31082f9a]
%%
%[text] ## Step 3: Inverse Kinematics
initialguess = theta0;
Td = T0;

% you need to implement IKinBody
[thetaSol, success] = ECE569_IKinBody(B,M,Td,theta0,1e-6,1e-6);
if (~success)
    close(f);
    error('Error. \nCould not perform IK at index %d.',1)
end
%%
%[text] (3c) Perform IK at each time step
thetaAll = zeros(6,N);
thetaAll(:,1) = theta0;

% you can comment out the waitbar functions if they aren't working
% (sometimes they don't work with .mlx files)
% If the code gets stuck here, you will need to restart MATLAB
f = waitbar(0,['Inverse Kinematics (1/',num2str(N),') complete.']);

for i=2:N
    % TODO: use previous solution as current guess
    initialguess = thetaAll(:, i-1);

    % TODO: calculate thetaSol for Tsd(:,:,i) with initial guess
    [thetaSol, success] = ECE569_IKinBody(B, M, Tsd(:,:,i), initialguess, 1e-6, 1e-6);
    if (~success)
        close(f);
        error('Error. \nCould not perform IK at index %d.',i)
    end
    thetaAll(:,i) = thetaSol;
    waitbar(i/N,f,['Inverse Kinematics (',num2str(i),'/',num2str(N),') complete.']);
end
close(f);
%%
%[text] (3c) Verify that the joint angles don't change very much
dj = diff(thetaAll');
plot(t(1:end-1), dj) %[output:75518531]
title('First Order Difference in Joint Angles') %[output:75518531]
legend('J1','J2','J3','J4','J5','J6','Location','northeastoutside') %[output:75518531]
grid on %[output:75518531]
xlabel('time (s)') %[output:75518531]
ylabel('first order difference') %[output:75518531]
%%
%[text] (3d) Verify that the joints we found actually trace out our trajectory (forward kinematics)
actualTsd = zeros(4,4,N);
for i=1:N
    % TODO: use forward kinematics to calculate Tsd from our thetaAll
    actualTsd(:,:,i) = ECE569_FKinBody(M, B, thetaAll(:, i));
end

xs = actualTsd(1,4,:);
ys = actualTsd(2,4,:);
zs = actualTsd(3,4,:);
plot3(xs(:), ys(:), zs(:), 'LineWidth', 1) %[output:2ff5fb51]
title('Verified Trajectory \{s\} frame') %[output:2ff5fb51]
xlabel('x (m)') %[output:2ff5fb51]
ylabel('y (m)') %[output:2ff5fb51]
zlabel('z (m)') %[output:2ff5fb51]
hold on %[output:2ff5fb51]
plot3(xs(1),ys(1),zs(1),'go','MarkerSize',10,'LineWidth',2) %[output:2ff5fb51]
plot3(xs(end),ys(end),zs(end),'rx','MarkerSize',10,'LineWidth',2) %[output:2ff5fb51]
legend('Trajectory', 'Start', 'End') %[output:2ff5fb51]
grid on %[output:2ff5fb51]
hold off %[output:2ff5fb51]
%%
%[text] (3e) Verify that the end effector does not enter a kinematic singularity, by plotting the determinant of your body jacobian
body_dets = zeros(N,1);
for i=1:N
    Jb = ECE569_JacobianBody(B, thetaAll(:, i));  % 6x6 body Jacobian at time i
    body_dets(i) = det(Jb);
end
plot(t, body_dets) %[output:5c176a76]
title('Manipulability') %[output:5c176a76]
grid on %[output:5c176a76]
xlabel('time (s)') %[output:5c176a76]
ylabel('det of J_B') %[output:5c176a76]
%%
%[text] (3f) Save to CSV File
% you can play with turning the LEDs on and off
led = ones(N,1);

% save to the CSV file
data = [t' thetaAll' led];

% TODO: change the csv filename to your purdue ID
writematrix(data, '0039367426.csv')

